        dots: true,
        infinite: true,
        slidesToShow: 3,
        slidesToScroll: 1,
      };
      if (data.length > 0) {
        newsTemplate = data.map(function (item, index) {
          return (
            <Wrapper>

            <div key={index}>
              <Card data={item} />
            </div>
            </Wrapper>
          );
        });
      } else {
        newsTemplate = <p>Please add some cards</p>;
      }
  



  

  
  
  

};

